// Robust parser for Calendly API v1 and v2
const payload = $input.item.json.body || $input.item.json;
const event = payload.event || 'invitee.created';
const data = payload.payload || payload;

// Extract invitee data
const invitee = data.invitee || data;
const eventDetails = data.event || data.scheduled_event || {};
const questions = data.questions_and_answers || invitee.questions_and_answers || [];

// Process custom form answers
const customAnswers = {};
questions.forEach(q => {
  customAnswers[q.question] = q.answer;
});

// Extract all relevant data
const email = invitee.email || '';
const name = invitee.name || 'Guest';
const startTime = eventDetails.start_time || invitee.start_time || '';
const endTime = eventDetails.end_time || invitee.end_time || '';
const timezone = invitee.timezone || 'UTC';
const meetingUrl = eventDetails.location?.join_url || invitee.meeting_url || '';
const eventType = eventDetails.event_type?.name || eventDetails.name || 'Meeting';
const cancelUrl = invitee.cancel_url || '';
const rescheduleUrl = invitee.reschedule_url || '';

// Determine event category
let eventCategory = 'created';
if (event.includes('canceled')) eventCategory = 'canceled';
if (event.includes('rescheduled')) eventCategory = 'rescheduled';

// Format dates for display
const startDate = new Date(startTime);
const formattedDate = startDate.toLocaleDateString('en-US', {
  weekday: 'long',
  year: 'numeric',
  month: 'long',
  day: 'numeric',
  timeZone: timezone
});
const formattedTime = startDate.toLocaleTimeString('en-US', {
  hour: '2-digit',
  minute: '2-digit',
  timeZone: timezone
});

return {
  json: {
    // Event metadata
    eventCategory: eventCategory,
    eventType: event,
    processedAt: new Date().toISOString(),

    // Invitee data
    email: email,
    name: name,
    timezone: timezone,

    // Meeting data
    meetingName: eventType,
    startTime: startTime,
    endTime: endTime,
    startTimeISO: startTime,
    formattedDate: formattedDate,
    formattedTime: formattedTime,
    meetingUrl: meetingUrl,
    cancelUrl: cancelUrl,
    rescheduleUrl: rescheduleUrl,

    // Custom answers
    customAnswers: customAnswers,

    // Unique ID for tracking
    eventId: `CAL-${Date.now()}-${Math.random().toString(36).substr(2, 9)}`
  }
};

// Capture error information
const error = $input.item.json;

return {
  json: {
    errorTime: new Date().toISOString(),
    errorMessage: error.message || 'Unknown error',
    errorNode: error.node?.name || 'Unknown',
    workflowName: 'Calendly Booking Automation',
    severity: 'HIGH'
  }
};
